import React, { memo } from 'react';
import styled from 'styled-components';

const ButtonContainer = styled.div`
    width: 40%;
    height: 260px;
    background-color: gray;
    border-radius: 5px;
    margin:20px 10px;
`;

const ItemBox = memo(() => {
    return (
        <ButtonContainer>
            
        </ButtonContainer>
    );
});

export default ItemBox;
